    # HKCR
    $path = "HKCR\CLSID_SKIP"
    # https://learn.microsoft.com/en-us/windows/win32/sysinfo/hkey-classes-root-key
    # HKCR represents a merged view of HKLM and HKCU hives on a live machine - we will skip it in these checks and instead just check the relevant items in HKLM and each user hive
    if (Test-Path -Path "Registry::$path") {
        $items = Get-ChildItem -Path "Registry::$path" | Select-Object * -ExcludeProperty PSPath,PSParentPath,PSChildName,PSProvider
        foreach ($item in $items) {
            $path = "Registry::"+$item.Name
            $children = Get-ChildItem -Path $path | Select-Object * -ExcludeProperty PSPath,PSParentPath,PSChildName,PSProvider
            foreach ($child in $children){
                $path = "Registry::"+$child.Name
                $data = Get-Item -Path $path | Select-Object * -ExcludeProperty PSPath,PSParentPath,PSChildName,PSProvider
                if ($data.Name -match '.*InprocServer32'){
                    $datum = Get-ItemProperty $path
                    $datum.PSObject.Properties | ForEach-Object {
                        if ($_.Name -eq '(Default)'){
                            $verified_match = $false
                            $clsid_found = $false
                            $expected_value = "N/A"
                            if ($default_hkcr_com_lookups.ContainsKey($data.Name)){
                                $clsid_found = $true
                                $expected_value = $default_hkcr_com_lookups[$data.Name]
                                try{
                                    if ($_.Value -match $default_hkcr_com_lookups[$data.Name]){
                                        $verified_match = $true
                                    }
                                } catch {
                                    Write-Reportable-Issue "Regex Error while parsing string: $($default_hkcr_com_lookups[$data.Name])"
                                }
                            }

                            if ($server_2022_coms.ContainsKey($data.Name) -and $verified_match -ne $true){
                                $clsid_found = $true
                                $expected_value = $server_2022_coms[$data.Name]
                                try{
                                    if ($_.Value -match $server_2022_coms[$data.Name]){
                                        $verified_match = $true
                                    }
                                } catch {
                                    Write-Reportable-Issue "Regex Error while parsing string: $($server_2022_coms[$data.Name])"
                                }
                            }

                            # Each hive will have 3 rounds of detection
                            # First Detection - if we have the CLSID and there is a mismatch
                            $item = Get-Item -Path $_.Value -ErrorAction SilentlyContinue
                            if ($verified_match -ne $true -and $clsid_found){
                                $detection = [PSCustomObject]@{
                                    Name = 'Potential COM Hijack - Mismatch on stored CLSID'
                                    Risk = 'Medium'
                                    Source = 'Registry'
                                    Technique = "T1546.015: Event Triggered Execution: Component Object Model Hijacking"
                                    Meta = [PSCustomObject]@{
                                        Location = $data.Name
                                        EntryName = $_.Name
                                        EntryValue = $_.Value
                                        ExpectedValue = $expected_value
                                        Hash = Get-File-Hash $_.Value
                                        Created = $item.CreationTime
                                        Modified = $item.LastWriteTime
                                    }
                                }
                                Write-Detection $detection
                            }

                            # Second Detection - if we do NOT have the cLSID and the file was created/modified within the last X days (configurable)
                            $created = ($item.CreationTime)
                            $modified = ($item.LastWriteTime)
                            if ((($created -ge $threshold_date) -or ($modified -ge $threshold_date)) -and $verified_match -ne $true){
                                $detection = [PSCustomObject]@{
                                    Name = 'Potential COM Hijack - Recently Modified or Created Entry'
                                    Risk = 'Low'
                                    Source = 'Registry'
                                    Technique = "T1546.015: Event Triggered Execution: Component Object Model Hijacking"
                                    Meta = [PSCustomObject]@{
                                        Location = $data.Name
                                        EntryName = $_.Name
                                        EntryValue = $_.Value
                                        ExpectedValue = $expected_value
                                        Hash = Get-File-Hash $_.Value
                                        Created = $item.CreationTime
                                        Modified = $item.LastWriteTime
                                    }
                                }
                                Write-Detection $detection
                            }

                            # Third Detection - Suspicious Directory for entry value
                            foreach ($path in $suspicious_process_paths){
                                if ($_.Value -match $path){
                                    $detection = [PSCustomObject]@{
                                        Name = 'Potential COM Hijack - Suspicious Entry Path'
                                        Risk = 'Medium'
                                        Source = 'Registry'
                                        Technique = "T1546.015: Event Triggered Execution: Component Object Model Hijacking"
                                        Meta = [PSCustomObject]@{
                                            Location = $data.Name
