                                            EntryValue = $_.Value
                                            ExpectedValue = $expected_value
                                            Hash = Get-File-Hash $_.Value
                                            Created = $item.CreationTime
                                            Modified = $item.LastWriteTime
                                        }
                                    }
                                    Write-Detection $detection
                                }
                            }
                        }
                    }
                }
            }
        }
    }

