function Clean-Up {
	<#
    .SYNOPSIS
        If we are targeting a non-local drive, clean up all mounted hives
    #>
	#Start-Sleep -seconds 5
	if ($drivechange) {
		foreach ($hive in $new_psdrives_list.GetEnumerator()) {
			$hive_key = $hive.Key
			if (Test-Path "Registry::$hive_key") {
				Unload-Hive $hive.Key $hive.Value
			}
		}
	}
}

